import { Col, Row, Container } from 'react-bootstrap';

class DisplaySearch extends Component {
constructor(props) {
    super(props);
    this.state = {Content: {}}
}
    componentDidMount() {
        fetch("/Data")
        .then(res => res.json())
        .then(
            (result) => {
                console.log(result);
                this.setState({
                    Content: result
                });
            },
            (error) => {
                console.log(error);
                this.setState({
                    Content: 'error'
                });
            }
        )
        
    }

    render() {
        const COPYCONTENTS = this.state.Content;
        const Copy = COPYCONTENTS.results;
        console.log(Copy);
        if (this.state.Content === 'error') {
            return <div>Error 404</div>;
        } else
        return (
            <div>

                <Container>
                    <Row>
                        <Col>
                        {/* {COPYCONTENTS.map((COPYCONTENT, index) =>{
                        return (
                            <ul key={index}>
                                <li>Id: {COPYCONTENT.results}</li>
                                 <li>Title: {COPYCONTENT.results}</li>
                                <li>Description: {COPYCONTENT.results}</li>
                                <li>URL: {COPYCONTENT.results}</li>
                            </ul>)})} */}
                        </Col>
                    </Row>



                </Container>


            </div>
        )


    }


}

export default DisplaySearch;
